import React from 'react';
import { View, Text } from 'react-native';

import styles from './styles';

const FormInput = ({
  containerStyle,
  label,
  placeholder,
  inputStyle,
  prependComponent,
  appendComponent,
  onChange,
  secureTextEntry,
  keyboardType = 'default',
  autoCompleteType = 'off',
  autoCapitalize = 'none',
  errorMsg = '',
}) => {
  return <Text>FormInput</Text>;
};

export default FormInput;
